"use strict";var swiper=new Swiper(".swiper-container",{spaceBetween:30,centeredSlides:!0,autoplay:{delay:5500,disableOnInteraction:!1},pagination:{el:".swiper-pagination",clickable:!0},navigation:{nextEl:".swiper-button-next",prevEl:".swiper-button-prev"}});document.addEventListener("DOMContentLoaded",function(){var e=document.querySelector("nav");window.addEventListener("scroll",function(){window.pageYOffset>e.clientHeight?e.classList.add("white-nav"):e.classList.remove("white-nav")});var t=document.querySelector(".burger-menu"),n=document.querySelectorAll(".burger-menu div"),i=document.querySelector(".links");t.addEventListener("click",function(){i.classList.toggle("reveal");for(var e=0;e<n.length;e++)n[e].classList.toggle("active")})});